import Sresult from './Sresult';

const Search = () => {
    const [img , setImg] = useState('');
    const inputEvent = (e) => {
        const data = e.target.value;
        console.log(data);
        setImg(data);
    }
  return (
    <>
      <input 
  style={{ color: 'blue', padding: '10px' , marginTop: '20px', borderRadius: ' 20px ', fontFamily: '' }} 
  type="text" 
  placeholder='Search anything' 
  value= { img}
  onChange = {inputEvent}
/>
<Sresult/>

    </>
  )
}

export default Search;
